import React, { Component } from 'react';
import { Link } from 'react-router-dom'

class MainNavbar extends Component {
    render(){
        return(
            <div className="MainNavbar" style={{marginBottom: "20px", width: "100%"}}>
                <h1 style={{display: "inline-block", width: "70%", textAlign: "left"}}>Color Palettes</h1>
                <div style={{display: "inline-block", width: "30%", textAlign: "right"}}>
                    <Link to ="/palette">Create Palette</Link>
                </div>
                
            </div>
        )
    }
}

export default MainNavbar;
